import React from 'react';
import {
  Container,
  Typography,
  Grid,
  Card,
  CardMedia,
  CardContent,
  CardActions,
  Button,
  Box,
  Rating,
  IconButton,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';
import DirectionsCarIcon from '@mui/icons-material/DirectionsCar';
import LocalGasStationIcon from '@mui/icons-material/LocalGasStation';
import SpeedIcon from '@mui/icons-material/Speed';

const Wishlist = () => {
  const navigate = useNavigate();

  // Mock wishlist data - in real app, this would come from an API
  const wishlistItems = [
    {
      id: 1,
      name: 'BMW 4 Series',
      price: '$28,700',
      rating: 4.5,
      image: 'https://images.unsplash.com/photo-1555215695-3004980ad54e?auto=format&fit=crop&w=400',
      mileage: '10,000 mi',
      fuelType: 'Petrol',
      transmission: 'Automatic',
    },
    {
      id: 2,
      name: 'Mercedes AMG GT',
      price: '$35,900',
      rating: 4.8,
      image: 'https://images.unsplash.com/photo-1617531653332-bd46c24f2068?auto=format&fit=crop&w=400',
      mileage: '5,000 mi',
      fuelType: 'Petrol',
      transmission: 'Automatic',
    },
    {
      id: 3,
      name: 'Audi RS7',
      price: '$32,500',
      rating: 4.6,
      image: 'https://images.unsplash.com/photo-1614200187524-dc4b892acf16?auto=format&fit=crop&w=400',
      mileage: '8,000 mi',
      fuelType: 'Petrol',
      transmission: 'Automatic',
    },
  ];

  const handleRemoveFromWishlist = (id) => {
    // Handle remove from wishlist logic here
    console.log('Remove from wishlist:', id);
  };

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Typography variant="h4" gutterBottom>
        My Wishlist
      </Typography>

      <Grid container spacing={3}>
        {wishlistItems.map((item) => (
          <Grid item xs={12} sm={6} md={4} key={item.id}>
            <Card
              sx={{
                height: '100%',
                display: 'flex',
                flexDirection: 'column',
                position: 'relative',
                '&:hover': { transform: 'translateY(-4px)', transition: 'transform 0.2s' },
              }}
            >
              <IconButton
                size="small"
                onClick={() => handleRemoveFromWishlist(item.id)}
                sx={{
                  position: 'absolute',
                  top: 8,
                  right: 8,
                  backgroundColor: 'white',
                  '&:hover': { backgroundColor: 'white', color: 'primary.main' },
                }}
              >
                <DeleteOutlineIcon />
              </IconButton>

              <CardMedia
                component="img"
                height="200"
                image={item.image}
                alt={item.name}
                sx={{ objectFit: 'cover' }}
              />

              <CardContent sx={{ flexGrow: 1 }}>
                <Typography gutterBottom variant="h6" component="h2">
                  {item.name}
                </Typography>

                <Typography variant="h6" color="primary.main" gutterBottom>
                  {item.price}
                </Typography>

                <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                  <Rating value={item.rating} precision={0.5} readOnly size="small" />
                  <Typography variant="body2" color="text.secondary" sx={{ ml: 1 }}>
                    ({item.rating})
                  </Typography>
                </Box>

                <Grid container spacing={1}>
                  <Grid item xs={6}>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <SpeedIcon fontSize="small" color="action" />
                      <Typography variant="body2" color="text.secondary">
                        {item.mileage}
                      </Typography>
                    </Box>
                  </Grid>
                  <Grid item xs={6}>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <LocalGasStationIcon fontSize="small" color="action" />
                      <Typography variant="body2" color="text.secondary">
                        {item.fuelType}
                      </Typography>
                    </Box>
                  </Grid>
                  <Grid item xs={12}>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <DirectionsCarIcon fontSize="small" color="action" />
                      <Typography variant="body2" color="text.secondary">
                        {item.transmission}
                      </Typography>
                    </Box>
                  </Grid>
                </Grid>
              </CardContent>

              <CardActions sx={{ p: 2, pt: 0 }}>
                <Button
                  size="small"
                  variant="outlined"
                  fullWidth
                  onClick={() => navigate(`/car/${item.id}`)}
                  sx={{ mr: 1 }}
                >
                  View Details
                </Button>
                <Button
                  size="small"
                  variant="contained"
                  fullWidth
                  onClick={() => navigate(`/car/${item.id}`)}
                >
                  Book Now
                </Button>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>

      {wishlistItems.length === 0 && (
        <Box
          sx={{
            textAlign: 'center',
            py: 8,
          }}
        >
          <Typography variant="h6" color="text.secondary" gutterBottom>
            Your wishlist is empty
          </Typography>
          <Button
            variant="contained"
            onClick={() => navigate('/')}
            sx={{ mt: 2 }}
          >
            Browse Cars
          </Button>
        </Box>
      )}
    </Container>
  );
};

export default Wishlist;
